import Topnavbar from '../../Components/Topnavbar'
import FollowersRandomPost from '../../Components/FollowersRandomPost'
import Usercard from '../../Cards/Usercard'

const Searchuserpage = ({ navigation }) => {

    let data = [
        {
            username: "himanshu",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "shantanu",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "shivam",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "manish",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "gourav",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "mohit",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "saurav",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "karan",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "himanshu",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "abhishek",
            profile_image: "data:image/jpeg;base64,"
        },
        {
            username: "dheeraj",
            profile_image: "data:image/jpeg;base64,"
        },
    ]

    const [keyword , setKeyword] = useState('')

    return (
        <View style={[styles.containerFull]}>
            <StatusBar />
            <Topnavbar navigation={navigation} />
            <Bottomnavbar navigation={navigation} page={"Searchuserpage"} />

            <TextInput style={[styles.searchbar]} placeholder="Search By username..."

                onChangeText={(text) => setKeyword
                    (text)}
            />
            <ScrollView style={[styles.userlists]}>
                {
                    data.filter(
                (user) => {
                    if(keyword == ''){
                        return user
                    }
                    else if(
                        user.username.
                        toLowerCase().includes
                        (keyword.toLowerCase())                       
                        
                    ) 
                    {
                        return user
                    }
                }
            ).map((item, index) => {
                        return (<Usercard user={item.username} profile={item.profile_image} />)
                    })
                }
            </ScrollView>
        </View>
    )
}

export default Searchuserpage

